const Filter = ({ onButtonClicked }) => {
    const handleFilterClick = (filter) => {
        onButtonClicked(filter);
    };

    return (
        <section className="FilterButtons">
            <button
                className="FilterButton"
                onClick={() => handleFilterClick("all")}
            >
                Filter 1
            </button>
            <button
                className="FilterButton"
                onClick={() => handleFilterClick("accesiores")}
            >
                Filter 2
            </button>
        </section>
    );
};

export default Filter;
